import React from 'react';

function Header({history}) {

    console.log(history);

    function onClick() {
        const goStart = window.confirm('시작 화면으로 돌아가시겠습니까? ');

        if (goStart) {
            return history.push("/");
        }
        else return null;
    }

    return (
        <div>
            <div className="Header" onClick={onClick}>
            {/* <div className="Header"> */}
                <div>투자 유니버스</div>
            </div>
        </div>
    );
}

export default Header;
